export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},oGkRsbDYSr:{data:{id:1020,attributes:{imdbId:"tt0997152",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzA2MTU2MDg2Nl5BMl5BanBnXkFtZTcwNDU5NjE4OA@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"}],item_lang:{data:{id:1683,attributes:{title:"The Experiment",plot:"For a handsome $1,000-a-day reward, the unemployed pacifist, Travis, decides to take part in a controversial two-week behavioural experiment that will attempt to simulate life within the prison walls. Now, inside a controlled environment, two hand-picked groups of twenty inmates and six guards must follow a simple set of basic rules, while high-tech cameras monitor the entire makeshift jail. However, devoid of their civil rights and their identities, the volunteers will soon find themselves dragged into a dangerous and volatile situation, as the sadistic warders begin to take extreme pleasure in enforcing their authority. Under those circumstances, Travis, or the rebellious Prisoner #77, will have to explore his limits. How long can he last?",slug:"the-experiment"}}},books:{data:[{id:5926,attributes:{title:"Apocalypsis - Brutal Awakening",description:"Journalist Peter Adam wakes up in Germany. The Cologne Cathedral. He has somehow survived near-fatal injuries. But his memory from the past few days has been erased. What happened? Why can't he remember? All around him the earth is shaking and Hell literally breaks loose as people spontaneously combust. It seems the apocalypse has begun... Meanwhile, the Vatican's chief exorcist has been elected pope. He has taken the name Peter II and seems set to fulfill the devastating prophecy of Malachi. The last hope for salvation? An enigmatic tattoo that has appeared all over Peter Adam's body: in it, a pattern of ancient symbols could reveal one of the greatest mysteries in human history-the origin of evil. About the Series Written by award-winning screenwriter and author Mario Giordano, \"Apocalypsis\" is gripping and explosive: what starts out as a sophisticated Vatican conspiracy soon develops into a uniquely intense and spectacular thriller. APOCALYPSIS is a serial novel told in twelve installments per book. The entire saga is revealed throughout three complete novels; this is the complete second novel. About the Author Mario Giordano was born 1963 in Munich, studied psychology in Düsseldorf and writes novels for adults old and young as well as screenplays (his credits include Tatort, Schimanski, Polizeiruf 110, Das Experiment). He lives in Berlin.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xN09AwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2014-04-28",publisher:c,subtitle:"Book 2"}},{id:5927,attributes:{title:g,description:h,thumbnail:i,authors:[b],firstBook:e,published:j,publisher:c,subtitle:k}},{id:5928,attributes:{title:"Apocalypsis 3.06 (ENG)",description:"Episode 6 - Tesseract: After a disturbing phone call with Sophia, Pope John Paul III has to risk a deal with Nakashima - and makes a troubling discovery. Shimon Kohn tells Maria and Don Luigi the story of his highly unusual life. He also takes Maria to an ancient location. 2013: Peter has to admit that Maya's warning in suite 306 was all too justified. In Israel, he and Nicholas meet Raymond again. Nicholas brings them to a place between times, where Peter encounters Maria - and he's supposed to open something that would have been better left sealed for all time. What is \"Apocalypsis\"? Written by award-winning screenwriter and author Mario Giordano, \"Apocalypsis\" is gripping and explosive: what starts out as a sophisticated Vatican conspiracy soon develops into a uniquely intense and spectacular thriller. \"Apocalypsis\" is a digital e-book series consisting of three seasons with 12 episodes each. This is the third season.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UtCrBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:l,publisher:c,subtitle:"Tesseract"}},{id:5929,attributes:{title:g,description:h,thumbnail:i,authors:[b],firstBook:e,published:j,publisher:c,subtitle:k}},{id:5930,attributes:{title:"Apocalypsis 3.12 (ENG)",description:"Episode 12 - Har-Magedon: The last day of humanity. Nakashima speaks of an offer from Pope John Paul III, a.k.a Seth. A last chance. At the agreed-upon meeting point in front of the Pantheon, Peter Adam - and his parallel 'I' - realize Nakashima has betrayed them. While Nakashima attempts to escape from the Spitsbergen bunker with the nine amulets, both he and Peter Adams lose consciousness in the Pantheon and see pure evil before them. As Maria prays at St. Peter's Square with the collected masses of people, Anselmo outdoes himself. For both the older and younger Peter Adam, there remains just one final way to end the apocalypse. A deadly way. What is \"Apocalypsis\"? Written by award-winning screenwriter and author Mario Giordano, \"Apocalypsis\" is gripping and explosive: what starts out as a sophisticated Vatican conspiracy soon develops into a uniquely intense and spectacular thriller. \"Apocalypsis\" is a digital e-book series consisting of three seasons with 12 episodes each. This is the third season.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aoGrBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:l,publisher:c,subtitle:"Har-Magedone"}}]}}},meta:{}}},prerenderedAt:1694069524978}}("movie","Mario Giordano","BASTEI LÜBBE","series",null,1,"Apocalypsis - Demons Among Us","Rome. Turmoil in the Eternal City. The pope has resigned and disappeared without a trace. Nobody knows if he is even still alive. At the same time, his closest confidants are being murdered in the most gruesome ways. As the conclave convenes to elect a successor to the Holy See, Vatican reporter Peter Adam begins to search for the missing pope. His search leads him to a mysterious underground religious fraternity, which has been working against the Church for centuries. Its members base their beliefs on a medieval prophecy: He who shall succeed the current Pope will call himself Peter II. And he will be the last to hold the See of St. Peter. Is the apocalypse at hand? And what will it bring? The fulfillment of mankind's oldest fantasies, or the end of the world? About the Series Written by award-winning screenwriter and author Mario Giordano, \"Apocalypsis\" is gripping and explosive: what starts out as a sophisticated Vatican conspiracy soon develops into a uniquely intense and spectacular thriller. APOCALYPSIS is a serial novel told in twelve installments per book. The entire saga is revealed throughout three complete novels; this is the complete second novel. About the Author Mario Giordano was born 1963 in Munich, studied psychology in Düsseldorf and writes novels for adults old and young as well as screenplays (his credits include Tatort, Schimanski, Polizeiruf 110, Das Experiment). He lives in Berlin.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=So4DxbYyLzwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2013-03-28","Book 1","2014-11-21"))